import React from 'react';
import Form from './form-reusable';

export default function PersonalForm() {
    const forname={
        title: 'Forename',
        placholder: 'Enter forename',
        name: 'forename',
        type:'text'
    }
    const dob={
        name: 'dob',
        title: 'Date of Birth: ',
        max:"2006-12-31",
        placholder: 'Date of Birth: ',
        type:'date'
    }
    const gender={
        name: 'gender',
        title:'Gender',
        options:['Male','Female'],
        type:'select'
    }
    const title={
        name: 'title',
        title:'Title',
        options:['Mr','Mrs','Miss','Ms','Baron','Baroness','Brigadier','Canon','Captain','Doctor','Duchess','Duke','Esquire','Father','Honorable','Inspector','Lady','Lord','Lt Colonel','Major','Most Reverend','Pastor','Professor','Rabbi','Rev Doctor','Reverend','Rt Reverend','Sir','Sister','Squadron Leader','Wing Commander'],
        type:'select'
    }
  return (
      <div className='container'>
          <div className='row'>
            <div className='col'>
                <Form input={title} />
            </div>
            <div className='col'>
                <Form input={dob} />
            </div>
            <div className='col'>
                <Form input={gender} />
            </div>
        </div>
      </div>

  );
}
